    "# Check for outliers using z-score method\n",
    "import numpy as np\n",
    "from scipy import stats\n",
    "\n",
    "# Calculate z-scores for both metrics\n",
    "z_scores_solar = np.abs(stats.zscore(df['Solar electricity generation (kWh)']))\n",
