    "\n",
    "# Find outliers (z-score > 3)\n",
    "outliers_solar = df[z_scores_solar > 3]\n",
    "outliers_usage = df[z_scores_usage > 3]\n",
    "\n",
    "print(\"Solar Generation Outliers:\")\n",
